11 a ، b ، g ، n ، ac ، ax (Wi-Fi 6) ، ثنائي النطاق ؛ تقنية MIMO و Wi-Fi Direct و Hotspot\r\nUSB: لايتنينج\r\nالميزات: الشحن ، منفذ سماعات الرأس\r\nالموقع: GPS ، A-GPS ، Glonass ، Galileo ، BeiDou ، QZSS ، معرف الخلية ، تحديد المواقع عبر Wi-Fi\r\nالمستشعرات: مقياس تسارع ، جيروسكوب ، بوصلة ، بارومتر ، ماسح ضوئي ليدار\r\nأخرى: NFC ، UMA (اتصال Wi-Fi)\r\nمتوافقة مع المعينات السمعية: M3 ، T4\r\nالماركة: آبل\r\nاللون: أزرق\r\nنوع نظام التشغيل: iOS\r\nسعة التخزين: 128 جيجابايت\r\nعدد مداخل ال SIM: شريحة واحدة و E-SIM\r\nدقة الكاميرا الخلفية: 12 ميجابكسل\r\nنوع الهاتف المحمول: Mobile Phone\r\nتقنية الشبكة الخلوية: 5G\r\nالشركة المصنعة للشرائح: Apple\r\nحجم الشاشة (انش): 6.7 انش\r\nرقم الموديل: iPhone 12 Pro Max\r\nسعة البطارية بالمللي امبير: 3687 مللي امبير\r\nالشحن السريع: نعم\r\nذاكرة الرام: 6 جيجا بايت","images":["https://student.valuxapps.com/storage/uploads/products/1615440322UAwSF.81KcqNGQIsL._SL1500_.jpg","https://student.valuxapps.com/storage/uploads/products/1615440322UjY4o.71DVgBTdyLL._SL1500_.jpg"],"in_favorites":false,"in_cart":false},{"id":55,"price":44500,"old_price":44500,"discount":0,"image":"https://student.valuxapps.com/storage/uploads/products/1615442168bVx52.item_XXL_36581132_143760083.jpeg","name":"لاب توب ابل ماك بوك برو","description":"يمكنك التمتع بتجربة الحوسبة بطريقة لم يسبق لها مثيل عندما تقوم باقتناء لاب توب ابل ماك بوك برو. يتميز هذا اللاب توب بمعالج انتل كور i5 من الجيل الثامن بتردد 2.3 جيجاهرتز والذي يضمن لك استمرار أداء النظام بكفاءة عالية. استمتع بتجربة تعدد المهام على نحو سلس وسريع باستخدام ذاكرة الوصول العشوائي بسعة 8 جيجا. يقدم لك معالج الرسومات الجرافيكية انتل ايريس بلس Intel Iris Plus Graphics صور بجودة عالية ويجعل تجربة اللعب الخاصة بك سلسة وممتعة بشكل لم يسبق له مثيل. يوفر نظام التشغيل ماك او اس macOS العديد من الميزات سهلة الاستخدام. قم بتخزين الأفلام المفضلة لديك، والتسجيلات الصوتية، والملفات الهامة الأخرى الخاصة بك بشكل مريح على الذاكرة اس اس دي SSD سعة 512 جيجا. تسمح لك شاشة العرض الرائعة حجم 13.3 انش بعرض الافلام المفضلة لديك والمحتويات الاخرى بجودة عالية. تتميز شاشة ريتينا Retina بإضاءة خلفية ال اي دي زاهية ونسبة تباين عالية تعزز تجربة المشاهدة الخاصة بك. توفر تقنية ترو تون True Tone تجربة مشاهدة طبيعية عن طريق ضبط توازن اللون الأبيض للشاشة حسب درجة حرارة لون الضوء من حولك. يتميز هذا اللاب توب بمخرجات صوتية متوازنة، وعالية الدقة، ونابضة بالحياة، ويوفر لك تجربة صوتية غامرة. تسمح لك شريحة ابل تي Apple T2 بتخزين البيانات الخاصة بك بتنسيق مشفر بمساعدة المعالج الثانوي سيكيور انكليف Secure Enclave. وعلاوة على ذلك، تعمل هذه الشريحة المتطورة على تعزيز وتشديد الحماية والامان لبياناتك بمساعدة من مستشعر التعرف على الهوية عن طريق اللمس Touch ID. يسمح لك هذا المستشعر المتقدم بإلغاء قفل الكمبيوتر المحمول باستخدام بصمات أصابعك فقط. تعمل عناصر التحكم بالشريط اللمسي Touchbar على تبسيط الأنشطة المختلفة مثل إرسال بريد إلكتروني أو تنسيق مستند معين. يمكن حمل لاب توب ابل ماك بوك برو خفيف الوزن بسهولة في حقيبة الظهر الخاصة بك. يتميز هذا اللاب توب باللون الرمادي والذي يضفي عليه مظهراً مميزاً وجميلاً.","images":["https://student.valuxapps.com/storage/uploads/products/1615442168ijV8V.item_XXL_36581132_143760083.jpeg","https://student.valuxapps.com/storage/uploads/products/161544216881jxI.item_XXL_36581132_143760084.jpeg","https://student.valuxapps.com/storage/uploads/products/1615442168uZNcz.item_XXL_36581132_143760087.jpeg","https://student.valuxapps.com/storage/uploads/products/1615442168VnIxG.item_XXL_36581132_143760088.jpeg"],"in_favorites":false,"in_cart":false},{"id":54,"price":11499,"old_price":12499,"discount":8,"image":"https://student.valuxapps.com/storage/uploads/products/1615441020ydvqD.item_XXL_51889566_32a329591e022.jpeg","name":"تليفزيون سمارت 65 بوصة 4K الترا اتش دي منحني من سامسونج UA65RU7300RXUM","description":"العلامة التجارية: سامسونج\r\nاللون: اسود\r\nالموديل: UA65RU7300\r\nالنوع: منحني\r\nالحجم: 65 بوصة\r\nمنفذ اتش دي ام اي: 3\r\nمنفذ يو اس بي: 2\r\nتليفزيون سمارت: نعم\r\nجهاز تحكم عن بعد واحد: نعم\r\nالدقة: 3,840 × 2,160\r\nالوزن: 25.0 كجم\r\nالابعاد (عرض × طول × عمق): 145.27 × 83.81 × 12.09