/// images : ["https://student.valuxapps.com/storage/uploads/products/1615440322UAwSF.81KcqNGQIsL._SL1500_.jpg","https://student.valuxapps.com/storage/uploads/products/1615440322UjY4o.71DVgBTdyLL._SL1500_.jpg"]
/// in_favorites : false
/// in_cart : false

class Products {
  int? id;
  int? price;
  int? oldPrice;
  int? discount;
  String? image;
  String? name;
  String? description;
  List<String>? images;
  bool? inFavorites;
  bool? inCart;

  Products({
      this.id, 
      this.price, 
      this.oldPrice, 
      this.discount, 
      this.image, 
      this.name, 
      this.description, 
      this.images, 
      this.inFavorites, 
      this.inCart});

  Products.fromJson(dynamic json) {
    id = json["id"];
    price = json["price"];
    oldPrice = json["old_price"];
    discount = json["discount"];
    image = json["image"];
    name = json["name"];
    description = json["description"];
    images = json["images"] != null ? json["images"].cast<String>() : [];
    inFavorites = json["in_favorites"];
    inCart = json["in_cart"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["id"] = id;
    map["price"] = price;
    map["old_price"] = oldPrice;
    map["discount"] = discount;
    map["image"] = image;
    map["name"] = name;
    map["description"] = description;
    map["images"] = images;
    map["in_favorites"] = inFavorites;
    map["in_cart"] = inCart;
    return map;
  }

}

/// id : 11
/// image : "https://student.valuxapps.com/storage/uploads/banners/1619472351ITAM5.3bb51c97376281.5ec3ca8c1e8c5.jpg"
/// category : {"id":26,"image":"https://student.valuxapps.com/storage/uploads/categories/1618883074tPenb.super.png","name":"سوبر ماركت"}
/// product : null

class Banners {
  int? id;
  String? image;
  Category? category;
  dynamic? product;

  Banners({
      this.id, 
      this.image, 
      this.category, 
      this.product});

  Banners.fromJson(dynamic json) {
    id = json["id"];
    image = json["image"];
    category = json["category"] != null ? Category.fromJson(json["category"]) : null;
    product = json["product"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["id"] = id;
    map["image"] = image;
    if (category != null) {
      map["category"] = category?.toJson();
    }
    map["product"] = product;
    return map;
  }

}

