class Category {
  int? id;
  String? image;
  String? name;

  Category({
      this.id, 
      this.image, 
      this.name});

  Category.fromJson(dynamic json) {
    id = json["id"];
    image = json["image"];
    name = json["name"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["id"] = id;
    map["image"] = image;
    map["name"] = name;
    return map;
  }

}